        <>
           <div className="lower_part_1">
                <div> 

                  <Four_P_Left></Four_P_Left>

                  <Four_P_Right></Four_P_Right>
                  
                </div>
           </div> 
        </>
    );
}

export default Four_P_Lowerpart;
